import React, { Component } from "react";

import { Row, Col, Card, Button, Icon, Progress } from "antd";

import TheChild from "./React";
const DataSet = require("@antv/data-set");




const sourceDataDaily = [
  {
    name: "Recieved",
    "1AM": 18.9,
    "2AM": 28.8,
    "3AM": 39.3,

  },
  {
    name: "Sent",
    "1AM": 90.9,
    "2AM": 71.8,
    "3AM": 99.3,

  }
];

class BankPersonal extends React.Component {
  render() {
    return (
      <TheChild
        ref={foo => {
          this.foo = foo;
        }}
      />
    );
  }

  componentDidMount() {
    var x = this.foo.myFunc();
    // x is now 'hello'
  }
}
export default BankPersonal;
